import React from 'react';

class App extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            bLength: '5'
        }
    }
    render() {
        return (
            <div>
                <div id='title'><h1>Pomodoro Clock</h1></div>
                  <div id='lengthDiv'>
                    <div id='breakLength'>
                        <h3>Break Length</h3>
                        <div id='pointerDiv'>
                        <button id='downArrow'><i class="arrow down"></i></button>
                        <span>{this.state.bLength}</span>
                        <button id='upArrow'><i class="arrow up"></i></button>
                        </div>
                    </div>
                      <div id='sessionLength'>
                          <h3>Session Length</h3>

                      </div>
                  </div>
                        <div id='clock'></div>
                          <div id='clockBtns'></div>
            </div>
        )
    }
}

export default App;
